                $('.navbar-top-links').i18n();
            });

            $('.set_en').on('click', function () {
                i18n.setLng('en', function () {
                    $('.i18container').i18n();
                    $('#side-menu').i18n();
                    $('.navbar-top-links').i18n();

                    $('.set_en').addClass('active');
                    $('.set_es').removeClass('active');
                });
